import React, { Component } from "react";

class Day extends Component {
  render() {
    const { data } = this.props;
    console.log("data", data);
    if (!data) return null;
    const { temp } = data.main;
    return (
      <div>
        <strong>{temp} celsius</strong>
      </div>
    );
  }
}

export default Day;
